    true,nt"url": null,nt"notes": "The Coso Magnetotelluric (MT) dataset of
    which the West Flank FORGE MT data is a subset, was collected by Schlumberger /
    WesternGeco and initially processed by the WesternGeco GeoSolutions Integrated EM
    Center of Excellence in Milan, Italy. The 2011 data was based on 99 soundings that
    were centered on the West Flank geothermal prospect. The new soundings along with
    previous data from 2003 and 2006 were incorporated into a 3D inversion. Full impedance
    tensor data were inverted in the 1-3000 Hz range. The modelling report notes several
    noise sources, specifically the DC powerline that is 20,000 feet west of the survey
    area, and may have affected data in the 0.02 to 10 Hz range. Model cell dimensions
    of 450 x 450 x 65 feet were used to avoid computational instability in the 3D model.
    The fit between calculated and observed MT values for the final model run had an
    RMS value of 1.807. The included figure from the WesternGeco report shows the sounding
    locations from the 2011, 2006 and 2003 surveys.",nt"license_title": "Creative
